import React from "react";
import RoomsItem from "./RoomsItem";

function Rooms() {
  return (
    <div className="rooms">
      <h1>Your result is here!</h1>
      <div classname="rooms__container">
        <div classname="rooms__wrapper">
          <div className="rooms__items"></div>
          <RoomsItem
            key="1"
            name=" Serviced AOLIVEpt Room"
            location="Salt Lake"
            totalGuest="4"
            rating="4.76"
            numberOfRating="5"
            like="100%"
            price="30,498"
            src="https://a0.muscache.com/im/pictures/67c84d14-4cd7-4bda-890d-a53fa4b8b113.jpg?aki_policy=large"
          />
        </div>
      </div>
    </div>
  );
}

export default Rooms;
